import React, { useCallback, useState } from "react";
import { useNavigate } from "react-router-dom";
import { PieChart, Pie, Sector } from "recharts";


const renderActiveShape = (props: any) => {
    const RADIAN = Math.PI / 180;
    const {
        cx,
        cy,
        midAngle,
        innerRadius,
        outerRadius,
        startAngle,
        endAngle,
        fill,
        payload,
        percent,
        value
    } = props;
    const sin = Math.sin(-RADIAN * midAngle);
    const cos = Math.cos(-RADIAN * midAngle);
    const sx = cx + (outerRadius + 10) * cos;
    const sy = cy + (outerRadius + 10) * sin;
    const mx = cx + (outerRadius + 30) * cos;
    const my = cy + (outerRadius + 30) * sin;
    const ex = mx + (cos >= 0 ? 1 : -1) * 22;
    const ey = my;
    const textAnchor = cos >= 0 ? "start" : "end";

    return (
        <g>
            <text x={cx} y={cy} dy={8} textAnchor="middle" fill={fill}>
                {payload.name}
            </text>
            <Sector
                cx={cx}
                cy={cy}
                innerRadius={innerRadius}
                outerRadius={outerRadius}
                startAngle={startAngle}
                endAngle={endAngle}
                fill={fill}
            />
            <Sector
                cx={cx}
                cy={cy}
                startAngle={startAngle}
                endAngle={endAngle}
                innerRadius={outerRadius + 6}
                outerRadius={outerRadius + 10}
                fill={fill}
            />
            <path
                d={`M${sx},${sy}L${mx},${my}L${ex},${ey}`}
                stroke={fill}
                fill="none"
            />
            <circle cx={ex} cy={ey} r={2} fill={fill} stroke="none" />
            <text
                x={ex + (cos >= 0 ? 1 : -1) * 12}
                y={ey}
                textAnchor={textAnchor}
                fill="#333"
            >{`PV ${value}`}</text>
            <text
                x={ex + (cos >= 0 ? 1 : -1) * 12}
                y={ey}
                dy={18}
                textAnchor={textAnchor}
                fill="#999"
            >
                {`(Rate ${(percent * 100).toFixed(2)}%)`}
            </text>
        </g>
    );
};



export default function Graph_Result(props) {
    const navigate = useNavigate();
    const pierecord = props.custom_data && props.custom_data.map((item) => {
        return ({ name: item.name, profit: item.profit });
    });

    function Display(item) {
        return (
            <>
                <h1>{item.name}</h1>
                <br />
                <h2>Weather</h2>
                <p>{item.weather}</p>
                <br />
                <h2>Seed Type</h2>
                <p>{item.seed}</p>
                <br />
                <h2>Fetilizers Used</h2>
                <p>{item.fertilizer}</p>
            </>
        );
    }

    return (
        <div>
            {props.custom_data && props.custom_data.map((item) => <Display name={item.name} weather={item.weather} seed={item.seed} fertilizer={item.fertilizer} />)}
        </div>
    )
}
